    "seney-wildlife-refuge-quarterly-narrative-report-november-1-1938-to-january-31-1939",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Seney
    National Wildlife Refuge outlines Refuge accomplishments from November of 1938 through
    January of 1939. The report begins by summarizing the weather conditions, water
    conditions, and food and cover conditions during the year. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, and
    plants- is also covered. The Refuge development and maintenance section discusses
    physical developments. The public relations section of the report describes recreational
    uses, Refuge visitors, hunting, and violations. Photographs are attached.",nt"license_title":
